{"org_name":"세종문화회관 세종미술관","use_fee":"전석 1만원","player":"피아니스트 박혜미는 예술의전당 음악영재아카데미, 서울예술고등학교를 졸업 후 도독하여 프랑크푸르트 국립음대에서 학사(Bachelor)및 석사(Master)과정을 졸업, 뮌스터 국립음대에서 연주자예비과정(Zertifikatstudienjahr)및 최고연주자과정(Konzertexamen)을 졸업하였다.  소년한국일보음악콩쿨 1위, 성정음악콩쿨 1위, 음악교육신문사콩쿨 특상, 경기도부천교육장배 및 전국학생음악콩쿨 1위, 한미음악콩쿨 등 다수 콩쿨에서 상위 입상하며 국내에서 두각을 드러내었고, Midwest University Missouri U.S.A. Alumni Scholarship Award 3위, Neapolitan Masters Competition 파이널리스트, G. Viotti Piano Competition, Verona Piano Competition, R. Schumann Piano Competition 등 다수 국제콩쿨에 참가 및 입상하여 연주자로서의 활동을 넓혔다.  국내외 유수홀의 무대에서 활발한 연주와 동시에 프랑크푸르트 음대 재학당시 베토벤 피아노 전곡 콘체르토 및 소나타 연주, 프랑크푸르트 Kursana Residenz, Kirche am Campus von Goethe Universitat 에서 수차례 독주회, 프랑크푸르트 St. Katharinenkirche 에서 실내악 및 독주연주, 뮌스터 스타인웨이 하우스 연주 등에 참여하였다.  그 외에 서울대학교 음악대학 국제 피아노 아카데미 참가 및 연주, Jerome Rose 마스터클래스 우수 연주자 초청연주, 싱가포르 국립음대(National University of Singapore) 초청 서울예고 실기우수자 마스터클래스, Gerlinde Otto, Andre Boainain, Thomas Hecht, Albert Tiu, Wolfgang Watzinger의 마스터클래스에 참가 및 연주하며 독일 여러 도시와 국외에서 다채로운 활동을 펼쳐왔다.  Musikschule Frankfurt am Main e.V 에서 반주강사를 역임하였고 금호아트홀 연세 귀국 독주회, 우인아트홀 유망주 콘서트, 쌀롱드무지끄 독주회 및 듀오 연주, 앙상블리안 기획 독주회, 용산 랜드홀 독주회, 아람문화기획 한양문고 하우스콘서트 등에서 다양한 연주를 가졌으며 이번 꿈의숲아트센터 독주회와 더불어 프라움 악기박물관 독주회를 통해 다양한 무대로 찾아 뵐 예정이다.","org_link":"https://www.sejongpac.or.kr:443/portal/performance/performance/view.do?performIdx=34266&menuNo=200004&sdate=2023-10-31&searchWrd=&searchSort=1&searchCnd=1&searchPlaceCdStr=P%2C9006&edate=2023-11-30&searchPackage=&pageIndex=2","guname":"강북구","main_img":"https://culture.seoul.go.kr/cmmn/file/getImage.do?atchFileId=cc9b6cbb15e04bbabb68d8eeaffd6038&thumb=Y","themecode":None,"date":"2023-11-18~2023-11-18","etc_desc":None,"end_date":1700233200000,"title":"박혜미 피아노 독주회 작곡가 B 시리즈 ","ticket":"시민","codename":"클래식","use_trgt":"누구나","program":"J.Brahms 7 Fantasies Op.116 (1833-1897) Capriccio. Presto energico Intermezzo. Andante Capriccio. Allegro passionato Intermezzo. Adagio Intermezzo. Andante con grazia ed intimissimo sentimento Intermezzo. Andantino teneramente Capriccio. Allegro agitato  J.S.Bach Chromatic Fantasy and Fugue in d-Minor BWV 903 (1685-1750) Fantasia, Recitativ, Fuga  Intermission  J.S.Bach Partita in G-Major No.5 BWV 829 (1685-1750) Preambulum  Allemande Corrente Sarabande Tempo di Minuetta Passepied  Gigue  J.Brahms Scherzo in e-Flat Minor Op.4 (1833-1897) Rasch und feurig, Trio 1, Trio 2  J.Brahms 4 pieces Op.119 (1833-1897) Intermezzo. Adagio  Intermezzo. Andantino un poco agitato Intermezzo. Grazioso e grazioso Rhapsodie. Allegro risoluto","lot":"37.6202544613023","rgstdate":"2023-10-31","strtdate":1700233200000,"place":"꿈의숲 아트센터 콘서트홀 ","hmpg_addr":"https://culture.seoul.go.kr/culture/culture/cultureEvent/view.do?cultcode=143915&menuNo=200008","lat":"127.044324732036","is_free":"유료"},
