{"org_name":"기타","use_fee":None,"player":"아우라 로젠버그 (b.1949)는 뉴욕에서 태어나 뉴욕과 베를린을 거주하며 작업하고 있다. 로젠버그는 이미지의 힘과 역사, 정체성, 가족, 젠더 등 사회적 맥락속에서의 이미지 의 관계와 개념에 대한 질문을 제기하며, 사회적 상호작용과 개인적 경험을 조명한다. 일상의 보편적 이미지가 그녀를 통해 재생산되며 그것을통해우리인간스스로를조금더 자연스럽게이해할수있도록50년간작업해왔다. 로젠버그의 작품은 구겐하임 박물관 (뉴욕, 미국), 바우하우스 박물관(바이마르, 독일), 뉴 뮤지엄 (뉴욕, 미국), 루마 재단 (아 를, 프랑스), 유대인 박물관 (베를린, 독일, )베이스 미술관 (마이애미 비치, 미국), 보이시 아트 미술관 (보이시, 미국), 신시내티 미술관 (신시내티, 미국), 캠퍼 현대미술 및 디 자인 미술관 (칸자스 시티, 미국) 등에 소장되어 있다.","org_link":"https://efremidis.com/en","guname":"강남구","main_img":"https://culture.seoul.go.kr/cmmn/file/getImage.do?atchFileId=d176281e9ea44c11b21be9f65e7d7fc8&thumb=Y","themecode":"기타","date":"2023-10-06~2023-10-28","etc_desc":None,"end_date":1698418800000,"title":"Statue also fall in love","ticket":"시민","codename":"전시/미술","use_trgt":"누구나","program":None,"lot":"37.5120707373175","rgstdate":"2023-09-27","strtdate":1696518000000,"place":"서울특별시 강남구 선릉로 112길 37 1층","hmpg_addr":"https://culture.seoul.go.kr/culture/culture/cultureEvent/view.do?cultcode=143519&menuNo=200009","lat":"127.046589906099","is_free":"무료"},
