{"org_name":"기타","use_fee":"전석 30,000원","player":"안무 나연우, 임정하","org_link":"https://www.sac.or.kr/site/main/show/show_view?SN=47499","guname":"서초구","main_img":"https://culture.seoul.go.kr/cmmn/file/getImage.do?atchFileId=3cba92fe9c1c4d59b5f367ab8a041fe9&thumb=Y","themecode":"기타","date":"2023-06-30~2023-07-02","etc_desc":None,"end_date":1688223600000,"title":"[테스트코레오그라피] 뉴-애튜 프로젝트","ticket":"기관","codename":"무용","use_trgt":"8세 이상","program":"2018년을 시작으로 현대무용의 안과 밖을 아우르는 레퍼토리를 배출해온 안무공모 프로젝트는 작품 공모심사를 통해 올해 <@test.choreography>, <뉴-애튜 프로젝트> 두 안무작을 발표한다. 나연우 안무가의 <@test.choreography>는 2020년 안무랩 프로젝트 초연 당시, 개인을 대상으로 테스트해 결과 값을 공연의 요소로서 발전시킨 리서치 작업을 바탕으로 올해는 극장에서 '안무'를 테스트해 다양한 질문을 던질 예정이다. 임정하 안무가의 <뉴-애튜 프로젝트>는 뉴-애티튜드(New Attitude) 의 합성어로 움직임을 대하는 태도에 대한 질문이자 몸과 움직임을 다양하게 바라보고자 한다. 2023년 안무가들이 던지는 질문을 발굴하고 ‘지금’의 관점에서 기존 작품의 재제작을 시도하며 동시대의 다양한 예술적 시각을 공유할 예정이다.","lot":"37.4802401962069","rgstdate":"2023-06-13","strtdate":1688050800000,"place":"예술의전당 자유소극장","hmpg_addr":"https://culture.seoul.go.kr/culture/culture/cultureEvent/view.do?cultcode=141997&menuNo=200008","lat":"127.014215239186","is_free":"유료"},
