{"org_name":"서울시청","use_fee":"무료","player":"개막축하공연에는 EDM 아티스트 배드보스크루 여성듀오그룹 클럽쏘울과 키즈댄스신동 강아라, 걸그룹 미니마니, 걸그룹 플로리아, 키즈스타 박서연과 벨리댄스 신동 신제나, 그리고 키즈스타 박시현 등이 참가. 이 중, 키즈댄스신동 강아라는 K-POP 힙합 장르를 뛰어넘는 유튜브 키즈스타로서의 공연무대를 보일 것이며, 박시현은 떠오르는 한국무용의 차세대 키즈스타로서 부산월드엑스포 홍보대사로도 활동하는데 아리랑 공연을 선보일 것이고, 멤버 전원이 KBS 트롯전국체전 출신인 걸그룹 미니마니와 함께, 부산월드엑스포 홍보대사로도 활동하고 있는 퍼포먼스 공연의 떠오르는 키즈스타인 박서연의 무대 공연. ","org_link":"http://www.koreawave.org/","guname":"종로구","main_img":"https://culture.seoul.go.kr/cmmn/file/getImage.do?atchFileId=f44125a3d3e34c7b8e69b6e3fa68ce2e&thumb=Y","themecode":"기타","date":"2023-05-18~2023-05-20","etc_desc":"3일간 다문화전통공연, 20일 오후2시 재한외국인 한글백일장 개최, 20일 저녁 7시 튀르키예 벨리댄스공연","end_date":1684508400000,"title":"2023 제16회 [서울국제문화축제]","ticket":"시민","codename":"축제-문화/예술","use_trgt":"국내외시민 누구나","program":"5월 가정의 달과 5월 20일 재한외국인을 대상으로 하는 세계인의 날로써 유엔에서 정한 세계문화다양성의 날을 맞아 재한외국인들의 다양한 문화를 한국의 수도인 서울(Seoul)의 중심인 광화문광장에서 다문화국가와 한국의 전국 문화예술 및 특산물(왕실진상품격) 도시(City)들과 함께 짝을 지어(Pair) 서울시민들에게 공연, 체험, 전시, 홍보 페스티벌(Festival)인 Seoul-Pair City Festival이라는 부제로 개최.  특히, 이러한 세계문화다양성의 날에 맞게 약 5개국 주한 외국 대사들을 초청하여 개막식을 개최하고, 봉산탈춤과 한국전통 혼례공연인 ‘함팔이공연’같은 한국전통공연뿐만 아니라 외국의 다문화전통공연도 3일간 내내 개최.","lot":"37.5718478584908","rgstdate":"2023-05-15","strtdate":1684335600000,"place":"서울 광화문광장 놀이마당","hmpg_addr":"https://culture.seoul.go.kr/culture/culture/cultureEvent/view.do?cultcode=141707&menuNo=200010","lat":"126.976168275947","is_free":"무료"},
