{"org_name":"기타","use_fee":None,"player":"작가 박효진은 현대사회에서 전통의 가치와 관습이 부딪치는 문제를 작업 소재로 다룬다. 일상에서 쌓이는 경험으로부터 역사 속 서사를 반영하는 예술 행위를 통해 작품의 주제를 전달하고, 관객과 상호 교감하며 시대의 흐름을 기록한다. 음악은 물론 퍼포먼스아트, 오브제, 설치, 영상, 사진 등 다양한 장르로 확장된 예술행동을 실천하고 있는 동시에 경계 없는 예술적 방향성을 바탕으로 다채로운 매체 작업을 통해 전통문화를 계승하고자 한다.","org_link":"https://www.parkhyojin.net/2023","guname":"강남구","main_img":"https://culture.seoul.go.kr/cmmn/file/getImage.do?atchFileId=8f010e261bc14ef1a24b12b01da9f25c&thumb=Y","themecode":None,"date":"2023-03-30~2023-04-06","etc_desc":None,"end_date":1680706800000,"title":"박효진 개인전 《입소리; 구음 (口音)》","ticket":"시민","codename":"전시/미술","use_trgt":"전체 이용","program":None,"lot":None,"rgstdate":"2023-03-24","strtdate":1680102000000,"place":"신사하우스 (서울 강남구 강남대로162길 27)","hmpg_addr":"https://culture.seoul.go.kr/culture/culture/cultureEvent/view.do?cultcode=141106&menuNo=200009","lat":None,"is_free":"무료"},
